// I re-enable the scrolling feature on the main viewport.\n  public enable(): void {\n\n    document.body.removeChild(this.styleTag);\n\n  }\n\n  // ---\n  // PRIVATE METHODS.\n  // ---\n  // I build and return a Style element that will prevent scrolling on the body.\n  private buildStyleElement(): HTMLStyleElement {\n\n    const style = document.createElement('style');\n\n    style.type = 'text/css';\n    style.setAttribute('data-debug', 'Injected by WindowScrolling service.');\n    style.textContent = `\n            body {\n                overflow: hidden !important ;\n            }\n        `;\n\n    return (style);\n\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/AppPage.html":{"url":"classes/AppPage.html","title":"class - AppPage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  AppPage\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            e2e/app.po.ts\n        \n\n\n\n\n\n            \n                Index\n                \n                    \n                        \n                            \n                                Methods\n                            \n                        \n                        \n                            \n                                \n                                    \n                                        getParagraphText\n                                    \n                                    \n                                        navigateTo\n                                    \n                                \n                            \n                        \n                    \n                \n            \n\n\n            \n                \n                    \n                        Methods\n                    \n                    \n                  